class Solution:
	def findSubstring(self, s, words):
		"""
		:type s: str
		:type words: List[str]
		:rtype: List[int]
		"""
		# j = 0
		if words == []:
			return []
		ans = set([])
		listword = list(itertools.permutations(words))
		joinword = [''.join(x) for x in listword]
		# for i in joinword:
		# 	j = s.find(i)
		# 	if j != -1:
		# 		ans.add(j)
		for i in joinword:
			# for match in re.finditer(i,s):
			# 	ans.add(match.start())
			j = 0
			while j < len(s):
				if s.find(i,j) != -1:
					ans.add(s.find(i,j))
					j += 1
				else:
					break

		return list(ans)



